    V_TMP_TIPO_DATA T_TIPO_DATA;
BEGIN
	DBMS_OUTPUT.PUT_LINE('[INICIO]');


	-- LOOP para insertar los valores --
	DBMS_OUTPUT.PUT_LINE('[INFO]: INSERCION EN '||V_TEXT_TABLA);

	V_SQL := 'SELECT COUNT(1) FROM ALL_TABLES WHERE TABLE_NAME = '''||V_TEXT_TABLA||''' AND OWNER = '''||V_ESQUEMA||'''';
	EXECUTE IMMEDIATE V_SQL INTO V_NUM_TABLAS;
	IF V_NUM_TABLAS = 0 THEN
			DBMS_OUTPUT.PUT_LINE('[INFO]: No exista la tabla');
	ELSE
		FOR I IN V_TIPO_DATA.FIRST .. V_TIPO_DATA.LAST
		LOOP
			V_TMP_TIPO_DATA := V_TIPO_DATA(I);

				V_MSQL := 'INSERT INTO '||V_ESQUEMA||'.'||V_TEXT_TABLA||' (
							CPP_PTDAS_ID
							, CPP_PARTIDA_PRESUPUESTARIA
							, DD_TGA_ID
							, DD_STG_ID
							, DD_CRA_ID
							, PRO_ID
							, EJE_ID
							, USUARIOCREAR
							, FECHACREAR
							, CPP_PRINCIPAL
							, DD_TBE_ID
							, CPP_APARTADO
							, CPP_CAPITULO
							, CPP_ACTIVABLE
							, CPP_PLAN_VISITAS
							, DD_TCH_ID
							, DD_TIM_ID
							, DD_TRT_ID
							, CPP_VENDIDO
							) 
							SELECT 
								'||V_ESQUEMA||'.S_'||V_TEXT_TABLA||'.NEXTVAL CPP_PTDAS_ID
								, '''||TRIM(V_TMP_TIPO_DATA(13))||''' CPP_PARTIDA_PRESUPUESTARIA
								, TGA.DD_TGA_ID
								, STG.DD_STG_ID
								, CRA.DD_CRA_ID
								, PRO.PRO_ID
								, EJE.EJE_ID
								, ''HREOS-11217'' USUARIOCREAR
								, SYSDATE FECHACREAR
								, '||TRIM(V_TMP_TIPO_DATA(16))||' CPP_PRINCIPAL
								, TBE.DD_TBE_ID
								, '''||TRIM(V_TMP_TIPO_DATA(11))||''' CPP_APARTADO
								, '''||TRIM(V_TMP_TIPO_DATA(12))||''' CPP_CAPITULO
								, '||TRIM(V_TMP_TIPO_DATA(7))||' CPP_ACTIVABLE
								, '||TRIM(V_TMP_TIPO_DATA(15))||' CPP_PLAN_VISITAS
								, TCH.DD_TCH_ID
								, TIM.DD_TIM_ID
								, TRT.DD_TRT_ID
								, '||TRIM(V_TMP_TIPO_DATA(4))||' CPP_VENDIDO
							FROM '||V_ESQUEMA||'.ACT_PRO_PROPIETARIO PRO
                            LEFT JOIN '||V_ESQUEMA||'.DD_CRA_CARTERA CRA ON CRA.DD_CRA_ID = PRO.DD_CRA_ID AND CRA.BORRADO = 0 AND CRA.DD_CRA_CODIGO = '''||TRIM(V_TMP_TIPO_DATA(1))||'''
							LEFT JOIN '||V_ESQUEMA||'.DD_TGA_TIPOS_GASTO TGA ON 1 = 1 AND TGA.BORRADO = 0 AND TGA.DD_TGA_DESCRIPCION = '''||TRIM(V_TMP_TIPO_DATA(5))||'''
                            LEFT JOIN '||V_ESQUEMA||'.DD_STG_SUBTIPOS_GASTO STG ON TGA.DD_TGA_ID = STG.DD_TGA_ID AND STG.BORRADO = 0 AND STG.DD_STG_DESCRIPCION = '''||TRIM(V_TMP_TIPO_DATA(6))||'''
							LEFT JOIN '||V_ESQUEMA||'.ACT_EJE_EJERCICIO EJE ON 1 = 1 AND EJE.BORRADO = 0 AND EJE.EJE_ANYO = ''2020''
							LEFT JOIN '||V_ESQUEMA||'.DD_TCH_TIPO_COMISIONADO_HRE TCH ON 1 = 1 AND TCH.BORRADO = 0 AND TCH.DD_TCH_CODIGO = '||TRIM(V_TMP_TIPO_DATA(14))||'
							LEFT JOIN '||V_ESQUEMA||'.DD_TBE_TIPO_ACTIVO_BDE TBE ON 1 = 1 AND TBE.BORRADO = 0 AND TBE.DD_TBE_CODIGO = '||TRIM(V_TMP_TIPO_DATA(3))||'
							LEFT JOIN '||V_ESQUEMA||'.DD_TIM_TIPO_IMPORTE TIM ON 1 = 1 AND TIM.BORRADO = 0 AND TIM.DD_TIM_CODIGO = '||TRIM(V_TMP_TIPO_DATA(8))||'
							LEFT JOIN '||V_ESQUEMA||'.DD_TRT_TRIBUTOS_A_TERCEROS TRT ON 1 = 1 AND TRT.BORRADO = 0 AND TRT.DD_TRT_CODIGO = '||TRIM(V_TMP_TIPO_DATA(9))||'
							WHERE PRO.BORRADO = 0 AND PRO.PRO_DOCIDENTIF IN ('||TRIM(V_TMP_TIPO_DATA(2))||')';
				EXECUTE IMMEDIATE V_MSQL;
				DBMS_OUTPUT.PUT_LINE('[INFO]: Se ha insertado el valor '''||TRIM(V_TMP_TIPO_DATA(2))||''','''||TRIM(V_TMP_TIPO_DATA(5))||''', '''||TRIM(V_TMP_TIPO_DATA(6))||''' y '''||TRIM(V_TMP_TIPO_DATA(13))||'''');
		END LOOP;
	END IF;
	COMMIT;
	DBMS_OUTPUT.PUT_LINE('[FIN]: TABLA '||V_TEXT_TABLA||' ACTUALIZADO CORRECTAMENTE ');

EXCEPTION
     WHEN OTHERS THEN
          ERR_NUM := SQLCODE;
          ERR_MSG := SQLERRM;
          DBMS_OUTPUT.put_line('[ERROR] Se ha producido un error en la ejecución:'||TO_CHAR(ERR_NUM));
          DBMS_OUTPUT.put_line('-----------------------------------------------------------'); 
          DBMS_OUTPUT.put_line(ERR_MSG);
          ROLLBACK;
          RAISE;   
END;
/
EXIT;
